import React, {Component} from 'react';
import server from './constants/server';
import './assets/styles/main.scss';
import axios from 'axios';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import SpecialTable from './components/special_table';

interface AppState {
  requested: boolean,
  units: any,
  totalMatches: number,
  value: number,
}

class App extends Component <{}, AppState> {
  constructor(props: object) {
    super(props);
    this.state = {
        requested: false,
        units: {},
        totalMatches: 1,
        value: 0,
    };
  }

  componentDidMount() { 
    axios.get(server + '/tft/summoner').then(response => {
      console.log(response.data);
      this.setState({...response.data, requested: true});
    })
  }

  handleChange = (stuff: any, item: number) => {
    this.setState({value: item});
  }

  render() { 
    const { requested, units, totalMatches, value } = this.state;

    return(
      <div className="App">
        <div className="app-container">
          <h3 className="center">TFT Insights</h3>
          <Tabs
            value={value}
            onChange={this.handleChange}
            indicatorColor="primary"
            textColor="primary"
            centered
          >
            <Tab label="EUW" />
            <Tab label="EUNE" />
            <Tab label="NA" />
            <Tab label="KR" />
          </Tabs>
          {!requested ? (
            <div className="center"><div className="lds-roller"><div></div><div></div><div></div><div></div><div></div><div></div><div></div><div></div></div></div>
          ) : (
            <>
              <SpecialTable 
                rows={units} 
                headers={['Unit', '1st Place' , 'Top 4']}
                elements={['unit', 'win', 'top']}
                primaryKey={"id"}
                orderCol="1st Place"
                orderDir="desc"
                rowCount={15}/>
              <p className="note">Data recovered from {totalMatches} of the latest matches of the top Challenger players of the selected region.</p>
              </>
          )}
        </div>
      </div>
    );
  }
}

export default App;
